window.bookSummaryJSON = "<p><i>Impact</i> is the 12th book in a series of near-future scifi thrillers whose heroine Ell Donsaii has a nerve mutation that makes her a genius and provides her some astonishing athletic abilities.&nbsp;</p> <p>In <i>Impact</i>, Ell’s been taken off the “Most Wanted” list and is resuming somewhat of a normal life. Her old friend Phil Zabrisk is on his way to Mars. One of her exploration rockets is about to land on an earthlike world.&nbsp;</p> <p>Then an enormous comet crashes into Tau Ceti three, threatening the lives of the teecees there. Aliens that Ell and others have come to think of as friends. Phil falls on Mars, breaking his hip in a fashion that needs surgery soon if he’s not to be crippled.&nbsp;</p> <p>Can she save her friends at Tau Ceti and is the risk of porting Phil back to Earth acceptable?&nbsp;</p> <p>Oh, and her son Zage is confounding people right and left....</p>"; 
